import React, { Component } from "react";
import Cards from "./Cards";
import "./CardList.css";

class CardList extends Component {
  render() {
    const { posts } = this.props;
    return (
      <div className="main">
        <h1>{posts.id}</h1>
        <Cards />

        <Cards />

        <Cards />
      </div>
    );
  }
}
export default CardList;
